import React from 'react';


/*Componentes */
import Header from './componentes/Header';
import Footer from './componentes/Footer';
import Tablauno from './componentes/Tablas/Tablauno';






function App() {
  return (
    <div className="container m-5">
<div className="row" style={[]}> 
        <Header/>
        </div>
        <div className="row">
        <Tablauno/>
        </div>

        <Footer/>


    </div>
  );
}

export default App;
